'use strict';

var React = require('react');

var _require = require('yylib-ui'),
    YYIcon = _require.YYIcon;

require('./goback.less');

var CPGoBack = React.createClass({
    displayName: 'CPGoBack',

    render: function render() {
        if (this.props.visible === false) {
            return null;
        } else {
            return React.createElement(
                'div',
                { className: 'cp2-goback', style: this.props.style, onClick: this.props.onClick },
                React.createElement(YYIcon, { title: this.props.title, type: 'left' })
            );
        }
    }
});

module.exports = CPGoBack;